import React, { Component } from 'react';
const Default = ['form-group tag default-tags'];
const outline = ['form-group tag outline-tags'];
const filled = ['form-group tag filled-tags'];
const filter = ['default', 'focus'];
class Tags extends Component {
    constructor(props)
    {
        super(props)
        this.state = {
            tags: [
                {
                    id: 1,
                    Title: 'Enabled',
                },
                {
                    id: 2,
                    Title: 'Hover',
                },
            ],
        }
    }
    render() {
        return (
            <div className="input-chips-wrapper tags-list">
                <div className="row">
                    <div className="col-md-2">
                        <div className="flex-div">
                            {this.state.tags.map((chipsList, i) => 
                                <div className={`${Default}`} key={i}> 
                                    <label className={filter[i]}> {chipsList.Title}
                                        <input name="selection" type="radio" id={i.id} className={chipsList.class}/>
                                    </label>
                                </div>
                            )}
                        </div>
                    </div> 
                </div>
            </div>
        );
    }
}

export default Tags;
